(2, 'Art workshop', 'e5320ae87ca9e30825c2df2a5b18f4a61605752410.jpg', '2020-11-11', '2020-11-11', 'Workshop hall', 'Sed blandit nulla a tincidunt blandit. Curabitur sit amet mauris finibus, lobortis elit sit amet, efficitur eros. Cras consequat tortor est, ac volutpat urna accumsan et. Aenean consectetur, nibh a viverra elementum, tortor purus dapibus leo, sollicitudin finibus massa turpis eu lorem. Vestibulum sed est urna. Ut ante arcu, tristique et massa non, mattis rhoncus quam. Donec leo est, lacinia dapibus nunc ac, varius varius justo. Etiam egestas nisi est, sed elementum diam commodo suscipit. Fusce volutpat, mi vitae tristique varius, risus nisi venenatis dui, in gravida lectus ligula a tellus. Sed mattis fermentum ex, nec dapibus lacus aliquam.'),
(4, 'Kristy Kutch Colored Pencil Workshops', 'f1e124c1bc3ffc24035cc9338b1a6a3c1606851433.jpg', '2020-12-25', '2020-12-26', 'ABC Architecturcentrum', '<h4 class=\"wkshpTitle\" style=\"font-family: \" helvetica=\"\" neue\",=\"\" helvetica,=\"\" arial,=\"\" sans-serif;=\"\" font-weight:=\"\" bold;=\"\" line-height:=\"\" 1.1;=\"\" color:=\"\" rgb(51,=\"\" 51,=\"\" 51);=\"\" margin-top:=\"\" 10px;=\"\" margin-bottom:=\"\" font-size:=\"\" 18px;=\"\" caret-color:=\"\" text-size-adjust:=\"\" auto;\"=\"\"><span style=\"color: rgb(109, 109, 109); font-family: Muli, sans-serif; font-size: 1.08em;\">Kristy Kutch has been creating colored pencil art for almost thirty years and has been teaching colored pencil workshops since 1991. A teacher with a life license, she applies many basic learning principles to her workshops, enthusiastically meeting each student at the appropriate level. Beginners are always welcome, but even advanced artists benefit from Kristy\'s instruction. Offering demonstrations of techniques and the characteristics of different types of colored pencils, papers, and other related materials, Kristy covers a wide range of possibilities. Kristy is the author of</span><span class=\"Apple-converted-space\" style=\"color: rgb(109, 109, 109); font-family: Muli, sans-serif; font-size: 1.08em;\">&nbsp;</span><em style=\"color: rgb(109, 109, 109); font-family: Muli, sans-serif; font-size: 1.08em;\">Drawing and Painting with Colored Pencil</em><span class=\"Apple-converted-space\" style=\"color: rgb(109, 109, 109); font-family: Muli, sans-serif; font-size: 1.08em;\">&nbsp;</span><span style=\"color: rgb(109, 109, 109); font-family: Muli, sans-serif; font-size: 1.08em;\">and</span><span class=\"Apple-converted-space\" style=\"color: rgb(109, 109, 109); font-family: Muli, sans-serif; font-size: 1.08em;\">&nbsp;</span><em style=\"color: rgb(109, 109, 109); font-family: Muli, sans-serif; font-size: 1.08em;\">The New Colored Pencil</em><span style=\"color: rgb(109, 109, 109); font-family: Muli, sans-serif; font-size: 1.08em;\">. She is also the feature artist in the Artist Palette Productions DVD \"Colored Pencil Landscapes: Beyond The Basics\". Kristy\'s workshops are held nationwide; each is an enjoyable, supportive, memorable experience in a beautiful location.</span><span class=\"Apple-converted-space\" style=\"color: rgb(109, 109, 109); font-family: Muli, sans-serif; font-size: 1.08em;\">&nbsp;</span><br></h4>'),
(6, 'Explore Your True Creativity with Mixed Media', '37f536d0dab927df754fe03ecceb71ba1606851826.jpg', '2021-02-05', '2021-02-08', 'Frans Hals Museum - Hal', '<h4 class=\"wkshpTitle\" style=\"font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-weight: bold; line-height: 1.1; color: rgb(51, 51, 51); margin-top: 10px; margin-bottom: 10px; font-size: 18px; caret-color: rgb(51, 51, 51); text-size-adjust: auto;\"><span style=\"color: rgb(109, 109, 109); font-family: Muli, sans-serif; font-size: 1.08em; font-weight: normal;\">Are you a beginning artist or someone interested in starting a creative practice? Have prior art experience, but would like to take your creativity to the next level? Mixed Media is the perfect way to free up your creativity, especially if you feel blocked or hesitant to start.</span><span class=\"Apple-converted-space\" style=\"color: rgb(109, 109, 109); font-family: Muli, sans-serif; font-size: 1.08em; font-weight: normal;\">&nbsp;</span><span class=\"charcoalNav\" style=\"color: rgb(109, 109, 109); font-family: Muli, sans-serif; font-size: 1.08em; font-weight: normal;\"><a href=\"https://truecreativitywithin.com/my-story/\" target=\"_blank\" style=\"color: rgb(109, 109, 109);\"><u>Lisa Agaran</u></a></span><span class=\"Apple-converted-space\" style=\"color: rgb(109, 109, 109); font-family: Muli, sans-serif; font-size: 1.08em; font-weight: normal;\">&nbsp;</span><span style=\"color: rgb(109, 109, 109); font-family: Muli, sans-serif; font-size: 1.08em; font-weight: normal;\">is a professional artist, instructor and creativity coach. She not only teaches you the basics, she will also show you how to blend a variety of techniques, materials and mediums for artistic freedom. Lisa offers online courses and live Zoom classes such as Mixed Media Abstract, Book of Creative Awakenings, Mixed Media Minis and more. When you allow mistakes &amp; accidents into the creative process, artistic magic happens.</span><br></h4>'),
(7, 'Judy Mudd Watercolor Workshops and Classes', '6e12982db2cf1b5422f739aeef30a1881606851985.jpg', '2020-12-16', '2020-12-26', 'Kathedraal Museum', '<span style=\"caret-color: rgb(109, 109, 109); color: rgb(109, 109, 109); font-family: Muli, sans-serif; font-size: 15.12px; text-size-adjust: auto;\">Online Workshops and Classes! Learn how to paint in watercolor from home! Judy has taught students to paint in watercolor for over 15 years. Step-by-step, students have a bird\'s eye view of Judy\'s painting setup, and can see every move from drawing, mixing paint on her palette, to brushwork and more. Sessions include reference photos, drawing guides prior to class, then group discussion regarding artistic concept and composition, Q&amp;A, warmup exercises, and pauses during the painting process for student reviews. Many students love these online lessons better than in-person because they see so much. Plus, all workshop and class sessions are recorded and available to download and keep for review over and over.</span>'),
(8, 'Gibson House Art Workshops/Retreats ', '3ae5bfb2f5c66f764097d4eb1a5c48531606852170.jpg', '2021-03-12', '2021-03-31', 'Corrie ten Boom House - The Hiding Place', '<h4 class=\"wkshpTitle\" style=\"font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-weight: bold; line-height: 1.1; color: rgb(51, 51, 51); margin-top: 10px; margin-bottom: 10px; font-size: 18px; caret-color: rgb(51, 51, 51); text-size-adjust: auto;\"><br></h4><p style=\"margin-bottom: 10px; caret-color: rgb(51, 51, 51); color: rgb(51, 51, 51); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 14px; text-size-adjust: auto;\"></p><p class=\"description\" style=\"margin-bottom: 10px; font-size: 1.08em; line-height: 21.168px; font-family: Muli, sans-serif; color: rgb(109, 109, 109); text-size-adjust: auto;\">The Gibson House Bed and Breakfast overlooks the peaceful landscape of New Hampshire\'s pristine Upper Connecticut River Valley, offering an idyllic setting for artists\' workshops/retreats. You will find yourself inspired by the charming, unspoiled New England village and the picture-perfect village, garden and mountain views. Two 50-foot-long porches insure outdoor work and relaxation in any weather. And the 2000 square foot art gallery and workshop features 12 foot ceilings with great illumination. A wide variety of workshops are taught by an accomplished group of artists/instructors who have a passion for teaching all experience levels. Attending a Workshop at the Gibson House is an experience you will long remember.<span class=\"Apple-converted-space\">&nbsp;</span></p>'),
(9, 'Textile Art Workshop', 'eb4fe59e77480943e7849d3d3479f5cc1606852305.jpg', '2021-04-09', '2021-04-11', 'Het Dolhuys', '<span style=\"caret-color: rgb(114, 114, 114); color: rgb(114, 114, 114); font-size: 16px; text-size-adjust: auto;\">Venture into the fantastic world of fabrics, stitch and mixed materials to make distinctive artworks full of colour, texture and meaning.&nbsp; Courses designed to help you explore the tactile and expressive art form that is beloved by artists like Grayson Perry and Yinka Shonibare. Join for a term and have time to develop and build your artwork with help from experienced supportive tutors. No experience needed, you can learn the skills from scratch.</span>'),
(10, 'Printmaking Workshop', '715f7bf8011be721ddfb93551b9262ca1606852418.jpg', '2021-05-07', '2021-05-14', 'Draaiorgelmuseum Haarlem', '<p style=\"padding-bottom: 20px; color: rgb(114, 114, 114); font-size: 16px; text-size-adjust: auto;\">Printmaking is a rewarding and challenging art form that enables even beginners to achieve great results from simple beginnings</p><p style=\"padding-bottom: 20px; color: rgb(114, 114, 114); font-size: 16px; text-size-adjust: auto;\">With experienced tutor and artist Jackie Shackson, students will be taught a range of printmaking techniques including Collagraph and Linocuts.</p><p style=\"padding-bottom: 20px; color: rgb(114, 114, 114); font-size: 16px; text-size-adjust: auto;\">Printmaking workshops are run on an individual basis so you can pick a date and in your three hour session you should achieve a series of prints to be proud of. All materials are included as is use of the printing press.</p>'),
(11, 'SHORT & INTENSIVE MASTER CLASSES', '5ae32853b2750307e3d29e601ad3e4c01606852831.jpg', '2021-06-25', '2021-06-30', 'Museum Haarlem', '<font size=\"3\" style=\"caret-color: rgb(102, 102, 102); color: rgb(102, 102, 102); font-family: &quot;Open Sans&quot;; text-align: justify; text-size-adjust: auto;\">The workshops offered by DARA are<span class=\"Apple-converted-space\">&nbsp;</span><strong>2</strong><strong>-day to 5-day intensives that cover a variety of drawing and painting disciplines</strong>. Each of the workshops are led by classically trained artists and instructors from around the world. Workshops are an excellent opportunity to study and incorporate the methods of a variety of different artists, and are designed to complement the training offered in our Part-Time Programme of study.<br><br>Our workshop students enjoy a complimentary light lunch and a friendly studio environment to hone their skills in figurative drawing and painting. All workshops promote our studio\'s fundamental philosophy of<span class=\"Apple-converted-space\">&nbsp;</span><strong>achieving artistic excellence through the development of a high level of technique and draftsmanship.</strong></font><br style=\"caret-color: rgb(102, 102, 102); color: rgb(102, 102, 102); font-family: &quot;Open Sans&quot;; font-size: 17px; text-align: justify; text-size-adjust: auto;\"><br style=\"caret-color: rgb(102, 102, 102); color: rgb(102, 102, 102); font-family: &quot;Open Sans&quot;; font-size: 17px; text-align: justify; text-size-adjust: auto;\"><strong style=\"caret-color: rgb(102, 102, 102); color: rgb(102, 102, 102); font-family: &quot;Open Sans&quot;; font-size: 17px; text-align: justify; text-size-adjust: auto;\"><font size=\"3\">​</font></strong><font size=\"3\" style=\"caret-color: rgb(102, 102, 102); color: rgb(102, 102, 102); font-family: &quot;Open Sans&quot;; text-align: justify; text-size-adjust: auto;\"><strong>Students of all levels of ability are welcome to register</strong>, although possessing some basic drawing skills will allow students to fully benefit from each course.</font>'),
(12, 'Still Life Painting with DIEGO GLAZER', '685b284b1f5b6d416d6f02113abf715f1606852995.jpg', '2021-10-26', '2021-10-30', 'Teylers Museum', '<br style=\"caret-color: rgb(102, 102, 102); color: rgb(102, 102, 102); font-family: &quot;Open Sans&quot;; font-size: 17px; text-align: justify; text-size-adjust: auto;\"><strong style=\"font-family: &quot;Open Sans&quot;; font-size: 17px; text-align: justify; text-size-adjust: auto; color: rgb(0, 0, 0);\">DATES:</strong><font color=\"#000000\" style=\"font-family: &quot;Open Sans&quot;; font-size: 17px; text-align: justify; text-size-adjust: auto;\">&nbsp;</font><span style=\"font-family: &quot;Open Sans&quot;; font-size: 17px; text-align: justify; text-size-adjust: auto; color: rgb(0, 0, 0);\">26 - 30 October</span><br style=\"caret-color: rgb(102, 102, 102); color: rgb(102, 102, 102); font-family: &quot;Open Sans&quot;; font-size: 17px; text-align: justify; text-size-adjust: auto;\"><strong style=\"font-family: &quot;Open Sans&quot;; font-size: 17px; text-align: justify; text-size-adjust: auto; color: rgb(0, 0, 0);\">HOURS:</strong><font color=\"#000000\" style=\"font-family: &quot;Open Sans&quot;; font-size: 17px; text-align: justify; text-size-adjust: auto;\">&nbsp;</font><span style=\"font-family: &quot;Open Sans&quot;; font-size: 17px; text-align: justify; text-size-adjust: auto; color: rgb(0, 0, 0);\">9:30 - 16:30 (lunch from 12:30 - 13:30), 30 hours total</span><br style=\"caret-color: rgb(102, 102, 102); color: rgb(102, 102, 102); font-family: &quot;Open Sans&quot;; font-size: 17px; text-align: justify; text-size-adjust: auto;\"><font color=\"#000000\" style=\"font-family: &quot;Open Sans&quot;; font-size: 17px; text-align: justify; text-size-adjust: auto;\"><strong>INSTRUCTOR:</strong>&nbsp;Diego Glazer<br><strong>LANGUAGE:</strong>&nbsp;English / Español<br><strong>LIMIT:</strong>&nbsp;10 artists maximum</font><br style=\"caret-color: rgb(102, 102, 102); color: rgb(102, 102, 102); font-family: &quot;Open Sans&quot;; font-size: 17px; text-align: justify; text-size-adjust: auto;\"><strong style=\"font-family: &quot;Open Sans&quot;; font-size: 17px; text-align: justify; text-size-adjust: auto; color: rgb(0, 0, 0);\">TUITION:</strong><span style=\"font-family: &quot;Open Sans&quot;; font-size: 17px; text-align: justify; text-size-adjust: auto; color: rgb(0, 0, 0);\">&nbsp;€695 -&nbsp;</span><em style=\"position: relative; font-family: &quot;Open Sans&quot;; font-size: 17px; text-align: justify; text-size-adjust: auto; color: rgb(0, 0, 0);\">this&nbsp;</em><em style=\"position: relative; font-family: &quot;Open Sans&quot;; font-size: 17px; text-align: justify; text-size-adjust: auto; color: rgb(0, 0, 0);\">includes some materials, complimentary lunch and refreshments</em><div><em style=\"position: relative; font-family: &quot;Open Sans&quot;; font-size: 17px; text-align: justify; text-size-adjust: auto; color: rgb(0, 0, 0);\"><br></em></div><div><em style=\"position: relative; font-family: &quot;Open Sans&quot;; font-size: 17px; text-align: justify; text-size-adjust: auto; color: rgb(0, 0, 0);\"><span style=\"caret-color: rgb(102, 102, 102); color: rgb(102, 102, 102); font-size: medium; font-style: normal; text-size-adjust: auto;\">Study the art of still life painting in this intensive 5-day workshop with classically trained artist Diego Glazer. The still life genre has its roots in the Netherlands, where it emerged as a distinct and respected art form during the 16th century. Today, it remains widely popular among both artists and collectors, and serves as the perfect setting for painters to study compositional design, color theory, and brush handling.</span><br style=\"caret-color: rgb(102, 102, 102); color: rgb(102, 102, 102); font-style: normal; text-size-adjust: auto;\"><br style=\"caret-color: rgb(102, 102, 102); color: rgb(102, 102, 102); font-style: normal; text-size-adjust: auto;\"><span style=\"caret-color: rgb(102, 102, 102); color: rgb(102, 102, 102); font-size: medium; font-style: normal; text-size-adjust: auto;\">Over the course of 30 hours of instruction, demonstrations, and one-on-one critiques, students in this workshop will work from a simple still life arrangement in order to study how indirect oil paintings are constructed. Diego will guide his students through the process of learning different strategies and techniques that can be used for constructing complex, multi-layered paintings.</span><br style=\"caret-color: rgb(102, 102, 102); color: rgb(102, 102, 102); font-style: normal; text-size-adjust: auto;\"><br style=\"caret-color: rgb(102, 102, 102); color: rgb(102, 102, 102); font-style: normal; text-size-adjust: auto;\"><span style=\"caret-color: rgb(102, 102, 102); color: rgb(102, 102, 102); font-size: medium; font-style: normal; text-size-adjust: auto;\">The core concepts that will be explored are those that help students to understand how underpainting, glazing, scumbling, color, value, and edges can complement their vision and achieve a more detailed composition of their paintings. With these skills, students will be well prepared to paint and design highly competent still life studies from their own studios.</span><br></em></div>'),
(13, 'The Flesh Tones Workshop with TINA GARRETT', 'ffd41b92b83077d8acc15bf9c870494f1606853282.jpg', '2021-11-29', '2021-12-02', 'Frans Hals Museum - Hof', '<br style=\"caret-color: rgb(102, 102, 102); color: rgb(102, 102, 102); font-family: &quot;Open Sans&quot;; font-size: 17px; text-size-adjust: auto;\"><font color=\"#f24600\" style=\"font-family: &quot;Open Sans&quot;; font-size: 17px; text-size-adjust: auto;\"><strong>DATES:</strong>&nbsp;29 Nov - 2 Dec 2021</font><br style=\"caret-color: rgb(102, 102, 102); color: rgb(102, 102, 102); font-family: &quot;Open Sans&quot;; font-size: 17px; text-size-adjust: auto;\"><strong style=\"font-family: &quot;Open Sans&quot;; font-size: 17px; text-size-adjust: auto; color: rgb(0, 0, 0);\">HOURS:&nbsp;</strong><font color=\"#000000\" style=\"font-family: &quot;Open Sans&quot;; font-size: 17px; text-size-adjust: auto;\">9:30 - 16:30 (lunch from 12:30 - 13:30), 30 hours total</font><br style=\"caret-color: rgb(102, 102, 102); color: rgb(102, 102, 102); font-family: &quot;Open Sans&quot;; font-size: 17px; text-size-adjust: auto;\"><strong style=\"font-family: &quot;Open Sans&quot;; font-size: 17px; text-size-adjust: auto; color: rgb(0, 0, 0);\">INSTRUCTOR:</strong><font color=\"#000000\" style=\"font-family: &quot;Open Sans&quot;; font-size: 17px; text-size-adjust: auto;\">&nbsp;Tina Garrett</font><br style=\"caret-color: rgb(102, 102, 102); color: rgb(102, 102, 102); font-family: &quot;Open Sans&quot;; font-size: 17px; text-size-adjust: auto;\"><strong style=\"font-family: &quot;Open Sans&quot;; font-size: 17px; text-size-adjust: auto; color: rgb(0, 0, 0);\">LANGUAGE:</strong><font color=\"#000000\" style=\"font-family: &quot;Open Sans&quot;; font-size: 17px; text-size-adjust: auto;\">&nbsp;English</font><br style=\"caret-color: rgb(102, 102, 102); color: rgb(102, 102, 102); font-family: &quot;Open Sans&quot;; font-size: 17px; text-size-adjust: auto;\"><strong style=\"font-family: &quot;Open Sans&quot;; font-size: 17px; text-size-adjust: auto; color: rgb(0, 0, 0);\">LIMIT:</strong><font color=\"#000000\" style=\"font-family: &quot;Open Sans&quot;; font-size: 17px; text-size-adjust: auto;\">&nbsp;12 artists maximum</font><br style=\"caret-color: rgb(102, 102, 102); color: rgb(102, 102, 102); font-family: &quot;Open Sans&quot;; font-size: 17px; text-size-adjust: auto;\"><strong style=\"font-family: &quot;Open Sans&quot;; font-size: 17px; text-size-adjust: auto; color: rgb(0, 0, 0);\">TUITION:</strong><font color=\"#000000\" style=\"font-family: &quot;Open Sans&quot;; font-size: 17px; text-size-adjust: auto;\">&nbsp;€980 -&nbsp;</font><em style=\"position: relative; font-family: &quot;Open Sans&quot;; font-size: 17px; text-size-adjust: auto; color: rgb(0, 0, 0);\">this&nbsp;</em><em style=\"position: relative; font-family: &quot;Open Sans&quot;; font-size: 17px; text-size-adjust: auto; color: rgb(0, 0, 0);\">includes all model fees, some materials, complimentary lunch and refreshments</em>'),
(14, 'Workshop Wintervogeltjes', '7794c1068f90801d55bce7c4968325c91606854147.jpg', '2021-07-27', '2021-06-28', 'Restaurant De Kleine Haag', '<h3 class=\"section__lead\" style=\"margin-top: 0.5rem; margin-bottom: 0.5rem; font-family: Lato, sans-serif; font-weight: 700; line-height: 1.5; color: rgb(0, 0, 0); font-size: 1.1rem; caret-color: rgb(0, 0, 0); letter-spacing: 2.72px; text-size-adjust: auto;\">Event details</h3><div class=\"section__main-content\" style=\"font-size: 16px; caret-color: rgb(0, 0, 0); color: rgb(0, 0, 0); letter-spacing: 2.72px; text-size-adjust: auto;\"><div class=\"event__detail-container\"><p class=\"event__detail\" style=\"margin-bottom: 1rem; padding-left: 10rem; font-size: 1rem;\"><span class=\"event__detail-label\" style=\"margin-left: -10rem; display: inline-block; width: 9.5rem; font-weight: 700;\">Locatie</span><span class=\"Apple-converted-space\">&nbsp;</span><span class=\"event__detail-content\"><a href=\"https://artpub.nl/locatie/restaurant-de-kleine-haag\" title=\"Restaurant De Kleine Haag\" data-toggle=\"modal\" data-target=\"#restaurant-de-kleine-haag-location-modal\" style=\"color: rgb(0, 0, 0); text-decoration-line: underline;\">Restaurant De Kleine Haag</a><br>Noordeinde 41B<br>1485 ET<br>Noordeinde<br></span></p><p class=\"event__detail\" style=\"margin-bottom: 1rem; padding-left: 10rem; font-size: 1rem;\"><span class=\"event__detail-label\" style=\"margin-left: -10rem; display: inline-block; width: 9.5rem; font-weight: 700;\">Datum</span><span class=\"Apple-converted-space\">&nbsp;</span>woensdag 27 januari 2021</p><p class=\"event__detail\" style=\"margin-bottom: 1rem; padding-left: 10rem; font-size: 1rem;\"><span class=\"event__detail-label\" style=\"margin-left: -10rem; display: inline-block; width: 9.5rem; font-weight: 700;\">Tijdstip</span><span class=\"Apple-converted-space\">&nbsp;</span>19:30</p><p class=\"event__detail\" style=\"margin-bottom: 1rem; padding-left: 10rem; font-size: 1rem;\"><span class=\"event__detai