(16, 'Workshop Naaktmodel Schilderen', 'dc2b234e716b94bf12ecf36c6b07d9b01606854362.jpg', '2021-07-22', '2021-07-23', 'Het Dolhuys', '<h3 class=\"section__lead\" style=\"margin-top: 0.5rem; margin-bottom: 0.5rem; font-family: Lato, sans-serif; font-weight: 700; line-height: 1.5; color: rgb(0, 0, 0); font-size: 1.1rem; caret-color: rgb(0, 0, 0); letter-spacing: 2.72px; text-size-adjust: auto;\">Dit is onze spannendste workshop: naaktmodel schilderen. Stiekem altijd al eens een naaktmodel willen schilderen? Een unieke ervaring, iets wat je waarschijnlijk niet elke dag doet. Het is een hilarisch, maar tegelijkertijd artistiek en gezellig programma van 2 uur.</h3>');
INSERT INTO `news` (`ID`, `Title`, `Category`, `Image`, `Content`, `PostingDate`, `LastUpdate`, `EmpID`) VALUES
(4, 'Pace to take over Blain Southern\'s former gallery in London expansion', 'Art Market', '1c61647f7203a68debc5eccc5a2b7a891605795074.jpg', '<p style=\"text-align: justify;\">A pandemic combined with the imminent Brexit deadline on 1 January 2021 might not seem the best time for a US-based gallery to take on a new London premises.\r\n\r\nBut Pace never has been cautious in its approach to gallery expansion.\r\n\r\nSo it is taking on a huge 8,600 sq. ft street level gallery, previously occupied by the now-defunct Blain Southern, at 4 Hanover Square in Mayfair, which will open in autumn 2021 following a major overhaul by Jamie Fobert Architects. Fobert designed Pace\'s original London gallery on Lexington Street, Soho, in 2011. The renovated space will feature two ground floor galleries, two private viewing rooms and the architect will also open up the basement level to create an additional 1,000 sq. ft gallery, reached by a black steel \"feature staircase\".\r\n\r\nPace, according to a statement, hopes to develop a \"more robust exhibition schedule\" at the new gallery, which will replace its home since 2012 at 6 Burlington Gardens, inside the Royal Academy of Arts building, which will close in summer 2021. According to the statement, Pace also hopes to \"engage with more European artists and continue to grow its contemporary programme\" through the beefed-up exhibition space. The new gallery space will also have room for live and experimental programming—something the gallery has been investing in heavily recently with its art and technology arm PaceX (launched last year) and the Superblue experiential art centre opening in Miami next month.\r\n\r\nPace\'s president and chief executive Marc Glimcher says this “larger gallery footprint... brings with it an expanding ambition for Pace in Europe\". Marian Goodman gallery recently announced the closure of its London space because, as Goodman said at the time, \"the current health crisis and Brexit have introduced even more uncertainty into the market, especially for galleries operating in London\".\r\n\r\nBut Glimcher is undeterred: \"This is a time for investment and faith in London. Its role as a cultural hub remains undisputed given the number of world class institutions on its turf, and even staring into the face of Brexit I am convinced that London will remain an economic capital of Europe and a crucial centre for the art market.\"\r\n\r\nHanover Square is currently one big building site due to the construction of the major Crossrail train and tube station, linking central London to Heathrow airport, and the building of a new Mandarin Oriental hotel.\r\n\r\nPace will no doubt hope that this announcement will take some attention away from reports on Artnet News in the past week of allegations of a \"toxic\" working environment and physical and verbal abuse of employees by two of the gallery\'s longstanding presidents in the US, Susan Dunne and Douglas Baxter. The gallery is currently conducting an investigation into these allegations and Baxter has taken an indefinite leave of absence.\r\n\r\nIn a statement given to The Art Newspaper today, the gallery says: \"We have had our share of workplace issues in the past and have worked to address them as they have been brought to our attention. The specific accusations being raised here refer to conduct that is unacceptable. We take these allegations very seriously and will bring them to the attention of our independent consultant and HR department to be investigated as part of our ongoing work. This behaviour does not reflect our values and that is why we are implementing structural change and accountability measures to ensure it does not occur in the future.\" \r\n\r\nRegarding Baxter, Glimcher said in an internal email to gallery staff: \"The investigation being conducted by outside counsel will continue to move forward as planned and Douglas has assured me of his complete cooperation. I want to emphasise that the investigation is as much about Pace as it is about the individuals on which it is focusing. I remain committed to using its findings to inform the policies and processes we are putting in place to ensure that Pace is a positive and equitable place to work.\"\r\n\r\nSource : https://www.theartnewspaper.com/</p>', '2020-11-19 14:11:14', '2020-11-19 15:26:54', 1),
(5, 'Pastures new: why some top gallery staff are moving on from longtime jobs', 'Art Market', 'd0ec5e76c3b1ccd37fd80f660feea9c01605795476.jpg', '<p style=\"text-align: justify;\">Personal Gmail accounts have been reactivated as some experienced gallery staff are either unexpectedly looking for work or seizing the (pandemic) day to try something new. Among the latter, recent senior level departures include Gary Waterston, at Gagosian gallery for 18 years and latterly as its managing director for Europe; Graham Steele, a partner at Hauser & Wirth and a force in its Los Angeles gallery; and Lock Kresler, a senior director at Lévy Gorvy and at the helm of its London outpost.\r\n\r\nThe circumstances of each departure are of course different, but uniting this trio is a sense that the introspection and out-of-office time afforded by the Covid-19 pandemic have forced a rethink. Kresler, who started at Lévy Gorvy in 2014, and just a week before his first child was born, feels that the London gallery has grown into a “more self-sufficient and larger operation” and that working from home distilled the need to strike a different balance. “Now I have two kids and want more flexibility,” he says—though he and Waterston are keeping their next moves close to their chests.\r\n\r\nThe chances are—as with Steele, who is starting a new private dealership—that neither is going to another traditional gallery role. The industry’s already-strained needs changed overnight once lockdowns struck. While in the Before Time, galleries needed as many staff as possible—to juggle art fairs, multiple installs and plenty of client entertainment—these aren’t coming back soon. Neither, on reflection, do they add up to a well-balanced life.\r\n\r\nWhat hasn’t changed is a broad appetite for art. “The growth that everybody became so comfortable with will just manifest itself differently,” says Waterston. He compares the art market favourably with more challenged industries such as hospitality.\r\n\r\nIt is optimistic, but there’s comfort to take from this right now. Just as after the last economic crisis, out of which the art adviser industry seemed to grow, an entrepreneurial spirit is emerging from the Covid crisis. Graham Southern, who left Blain Southern last year (before the gallery he co-founded went into administration and shut down), has started an artist management business, a relatively untapped area that many think will grow more. “I didn’t predict the pandemic, but this seems even more relevant since,” Southern says. Digital advances will also not disappear in the After Time and will create opportunities for those who can harness and adapt them best.\r\n\r\nThe latest Art Basel & UBS Art Market Report found that, on average, a third of the 795 galleries surveyed cut their staff in the first six months of 2020. Separate research by UBS’s Global Wealth team has also found a surge in new business formation in major economies around the world, including in the US, where business registrations are up 14% compared to the same period last year. This, the bank finds, is not just about finding something to do, but represents a gauge of economic confidence.\r\n\r\nWe’ve been thrown a curve ball, and not every new idea is going to fly. But crises disrupt industries, throw out accepted norms to make way for new, entrepreneurial models—particularly when married with long experience. Right now, fortune favours the brave.\r\n\r\nSource : https://www.theartnewspaper.com/</p>', '2020-11-19 14:17:56', '2020-11-19 15:28:02', 1);
