(1, 'aboutus', 'About Us', '<div style=\"text-align: justify;\">We are here to bring people into contact with the richness of Haarlem’s art and culture.&nbsp;</div><div style=\"text-align: justify;\">We provide art activities such as annual art festival, workshops, exhibitions, etc for artists, tourists and locals of Haarlem...</div>', '2020-11-14 10:10:21', '2020-11-17 20:10:05', 1),
(2, 'contactus', 'Contact Us', '<div><div><b>Email: </b>lan@fhict.nl&nbsp;</div><div><b>Phone: </b>0664926868</div></div><b>Address:</b> Rachelsmolen 1, 5612 MA<div>Eindhoven, Netherlands</div>', '2020-11-14 10:11:21', '2020-11-16 13:52:30', 1);
INSERT INTO `partner` (`ID`, `Name`, `Category`, `Address`, `Image`, `Description`, `CreationDate`, `LastUpdate`, `EmpID`) VALUES
(1, 'ABC Architecturcentrum', 'Art & Design', 'Groot Heiligland 47', 'd4816ede8163b523121acaff3556bd161604442500.png', '<div style=\"text-align: justify;\">The ABC is the center for architecture and urban development in Haarlem and the Kennemerland region. We want to share our passion for the built environment with you. For this we organize activities and exhibitions for young and old. Activities and Exhibitions You can contact us for exhibitions, lectures, symposia, discussions, workshops and also children\'s parties. If an exhibition lends itself to it, we organize interesting excursions. For us, architecture and urban design is about all art forms associated with it; interior architecture, urban design, spatial planning, and garden and landscape architecture. \'Museum\' Although we are not an official museum, since 1 July 2018 we do accept the Museum Card and you can also enter us for free. This is because the Museum Association has accepted us as an \'affiliated member\' on the basis of policy, organization and exhibitions.</div><div style=\"text-align: justify;\"><br></div>', '2020-11-14 09:52:50', '2020-11-17 20:10:29', 1),
(2, 'Archeologisch Museum Haarlem', 'History & Anthropology', 'Grote Markt 18k ', '62b70f1b699c9fd94ce16ef66361d6531604443476.jpeg', '<div style=\"text-align: justify;\">The Archaeological Museum Haarlem is located in the seventeenth century vaulted cellar of the Vleeshal on the Grote Markt in the center of Haarlem. It is a museum of urban archeology; with archaeological finds from Haarlem and surroundings. \r\n\r\nThe Archaeological Museum takes children into account. The showcases have a pleasant height for children. There are treasure hunts and you can work as an archaeologist in our mini excavation. Do you want to come with your class; which can. Especially for school classes, there are guided tours that are expanded with assignments, such as the identification of shards or soil samples.</div>', '2020-11-14 09:52:53', '2020-11-17 20:10:45', 1),
(3, 'Artisklas Haarlem', 'Nature & Natural History', 'Arthur van Schendelpad 1 ', '92abdd6d58efda40e5bab7586187fcf21604443845.jpg', '<div style=\"text-align: justify;\">The Artisklas Haarlem Foundation is located in Haarlem-Noord and is the smallest official zoo in the Netherlands. The foundation has four point houses and an outside area with a number of accommodations. In one of the houses different types of reptiles and invertebrates are housed. A second house contains the first and only diorama of Haarlem with eight biotopes and the (stuffed) animals belonging to them. Here are also animals in \r\n\r\nformaldehyde, a collection of skulls, shells, etc. House no. Three is used as a feed kitchen, feed storage and quarantine. The fourth house serves as a cash register, class room, office, canteen for employees, emergency treatment room, etc. The outdoor enclosures include a number of larger animals. \r\n\r\n  \r\n\r\nWe are open to the public on Saturday and Sunday and you can come and see our animals and enjoy. \r\n\r\nHowever, our animals come first and can, if they wish, always hide. \r\n\r\n  \r\n\r\nOur volunteers have all kinds of tricks for many animals to lure them out and they are of course always happy to answer any questions you may have. \r\n\r\n  \r\n\r\nIn this we also distinguish ourselves from the larger zoos, since the small scale allows us to spend more time on human / animal contact and direct education.</div>', '2020-11-14 09:52:56', '2020-11-17 20:10:50', 1),
(4, 'Corrie ten Boom House - The Hiding Place', 'History & Anthropology', 'Barteljorisstraat 19', '1d747a63901970ca2fe344695b2109231604443908.jpg', '<div style=\"text-align: justify;\">The Corrie ten Boom Museum is located in the house where three generations of the Ten Boom family lived between 1837 and 1945. The Corrie ten Boom House can only be visited with a guided tour. During a tour, visitors receive information about Corrie and her family, and about the events that took place in the Ten Boom house before and during the Second World War. Visitors can see the hiding place, family photographs and objects from the Second World War. The entire upper floor has been made into an exhibition hall.&nbsp;</div>', '2020-11-14 09:52:59', '2020-11-17 20:12:11', 1),
(5, 'Draaiorgelmuseum Haarlem', 'Specialized & Alternative', 'Kuppersweg 3', 'e729e49976cb3916c920c6c8f93bc0cc1604443976.jpg', '<div style=\"text-align: justify;\">The museum shows a collection of different pieces, like some dance, cafe, street and fair organs. Het Kunkels Orgel is a concert organ and the biggest of its type in Europe. There are also theater organs, like Lady Compton, that were used for the musical accompaniment of silent films. The eldest organ in the museum dates from 1900. \r\n\r\n  \r\n\r\nIn the museum concerts with organs are held frequently. One of the used instruments is De Lange Gavioli that can be heard since a long restoration was fulfilled in 2016. An organ that was borrowed for some years, was the Pod (nl), a sister organ of the Schuyt; the latter one was built by Carl Frei, shortly later than Het Kunkels Orgel. Next to that, the museum frequently organizes barrel organ events.&nbsp;</div>', '2020-11-14 09:53:02', '2020-11-17 20:13:03', 1),
(6, 'Frans Hals Museum - Hal', 'Art & Design', 'Grote Markt 16', 'b453a56cc43fbd1939d15dc7aa97b51d1604444681.jpg', '<div style=\"text-align: justify;\">Frans Hals Museum - Hal (until March 29 2018: De Hallen Haarlem) is one of the two locations of the Frans Hals Museum, located on the Grote Markt, Haarlem, Netherlands, where modern and contemporary art is on display in alternating presentations. The emphasis is on contemporary photograph and video presentations, with the focus on Man and society. \r\n\r\n  \r\n\r\nThe museum consists of three different buildings, the Vleeshal (Flesher\'s hall) on the east side and the Verweyhal (named for Kees Verwey) on the west side are two large \"halls\" sandwiching the small entrance building. All three buildings are National Heritage sites today.</div>', '2020-11-14 09:53:04', '2020-11-17 20:13:16', 1),
(7, 'Frans Hals Museum - Hof', 'Art & Design', 'Groot Heiligland 62', '4cbdcd21e3281d5d759596fe5da698dd1604444737.jpg', '<div style=\"text-align: justify;\">The Frans Hals Museum is divided over two locations: Hof and Hal. They are a short but pleasant walk through historic Haarlem apart. \r\n\r\nOld men originally lived at the Hof location, which now houses art treasures. In the Golden Age they enjoyed their golden years here. But since 1913, the urban art collection has been exhibited around the courtyard at the Groot Heiligland, with numerous highlights from the same Golden Age. \r\n\r\n1908 the municipality bought the premises to exhibit the urban art collection. It hung way too tight in the town hall. Large parts of the old men\'s house were demolished and rebuilt in an early 17th-century style, after a design by city architect Lucas Christiaan Dumont. From May 14, 1913, the public could enjoy the Frans Hals Museum.</div>', '2020-11-14 09:53:06', '2020-11-17 20:13:37', 1),
(8, 'Het Dolhuys', 'Specialized & Alternative', 'Schotersingel 2', '9beb3e735045dec35671b961657191731604444795.jpg', '<div style=\"text-align: justify;\">The Dolhuys in the North Holland city of Haarlem is a museum in a former madhouse , where insane people have been cared for since the 16th century. The main theme of the museum is the psyche and spirit of man in all its facets. \r\n\r\nThe Dolhuys is a so-called experience museum: it is not about the collection of objects but about experiences and opinions and wants to show that the line between crazy and normal is sometimes difficult to draw. The museum provides an overview of how \'madness\' has been dealt with over the centuries. In addition to the permanent exhibition, there are changing exhibitions. Visitors can test themselves: \'How normal are you?\'. The museum also has a collection of art, including a number of important works by outsider artist Willem van Genk . \r\n\r\nIn 2005 the museum won the Dutch Design Prize in the Exhibition &amp; Experience Design category . In 2007 it received an honorable mention at the European Museum of the Year Award .&nbsp;</div>', '2020-11-14 09:53:08', '2020-11-17 20:13:53', 1),
(9, 'Kathedraal Museum', 'Art & Design ', 'Leidsevaart 146', 'a85178dd14ada013bb902ff99539fb081604444846.jpg', '<div style=\"text-align: justify;\">The museum contains special art treasures including paintings, sculptures, banners, liturgical silverware by Louis Napoleon and currently 150 postcards about the cathedral and an exhibition about the restoration. The museum is located in the crypt under the choir and includes a large, attractively decorated exhibition room. \r\n\r\nIn time, expansion will follow in spaces under the ambulatory and the radial chapels. The Cathedral Museum is the continuation of the Treasury of the Katehdraal, which existed from 1973 to 2009. The Treasury was housed in the relatively small Episcopal Sacristy. The growth of the collection and the increase in the public made expansion necessary.&nbsp;</div>', '2020-11-14 09:53:10', '2020-11-17 20:14:01', 1),
(10, 'Koepelkathedraal Haarlem', 'History & Anthropology', 'Bisschop Bottemanneplein 2014', '44be73dfc8120015388421da865627451604444894.jpeg', '<div style=\"text-align: justify;\">The Dome Cathedral of Haarlem is unique and, with the Sagrada Familia, the Sacré-Coeur, the Westminster Cathedral and the Basilica of Koekelberg, is one of the top five most important churches in the world built between 1850 and 1950. The mighty cathedral was designed by Joseph Cuypers and is bigger than Cologne Cathedral. It has 12 large and small towers and a dome of 65 meters high! The cathedral contains architectural styles such as neo-gothic, neo-Romanesque, Jugendstil and style elements of the Amsterdam School and Berlage.&nbsp;</div>', '2020-11-14 09:53:13', '2020-11-17 20:14:09', 1),
(11, 'Museum Haarlem', 'History & Anthropology ', 'Groot Heiligland 47', 'f884b671c005191af876755f5e476eb31604444990.jpeg', '<div style=\"text-align: justify;\">Museum Haarlem is a museum in Haarlem about the history and cultural heritage of Haarlem and Zuid-Kennemerland . The city museum is located in the historic center of Haarlem at Groot Heiligland 47, diagonally opposite the Frans Hals Museum . \r\n\r\n  \r\n\r\nThe permanent exhibition portrays eight centuries of city and regional history of Haarlem and Zuid-Kennemerland. This exhibition deals with the Golden Age when Haarlem was one of the most powerful and richest cities in Holland, the 19th century when the city experienced a new rich period and recent history due to industrialization. The exhibition is divided into the themes of work, living, power, faith and art and science. \r\n\r\n  \r\n\r\nEvery six months there is an exhibition on a theme from the history of Haarlem and Zuid-Kennemerland. There are also changing exhibitions of Haarlem artists.</div>', '2020-11-14 09:53:15', '2020-11-17 20:14:17', 1),
(12, 'NZH Public Transport Museum', 'Science & Technology', 'A.Hofmanweg 35', 'cbdcbb48609a187af240476381b7a16b1604445051.jpeg', '<div style=\"text-align: justify;\">The museum was opened in 1996 and aims to conserve the cultural heritage of the old tramway lines in the region, located on the historic tram depot of the Eerste Nederlandsche Electrische Tram-Maatschappij, built in 1899, which later in 1904 became the tram depot of the Electrische Spoorweg-Maatschappij (ESM), and still later the bus depot of the NZH. The tram line Amsterdam – Haarlem – Zandvoort ran until August 31, 1957, when trams were replaced by buses. The bus depot closed in 2006, but the museum is located on a small piece of land still owned by the NZH at the back.&nbsp;</div>', '2020-11-14 09:53:18', '2020-11-17 20:14:27', 1),
(13, 'Teylers Museum', 'Science & Technology ', 'Spaarne 16', 'f90451b04784260be72557060adfbf851604445096.jpg', '<div style=\"text-align: justify;\">Teylers Museum (Dutch pronunciation: [ˈtɛilərs myˈzeːjɵm]) is an art, natural history, and science museum in Haarlem, Netherlands. Established in 1778, Teylers Museum was founded as a centre for contemporary art and science. The historic centre of the museum is the neoclassical Oval Room (1784), which was built behind the house of Pieter Teyler van der Hulst (1702–1778), the so-called Fundatiehuis (Foundation House). Pieter Teyler was a wealthy cloth merchant and banker of Scottish descent, who bequeathed his fortune for the advancement of religion, art, and science. He was a Mennonite and follower of the Scottish Enlightenment.</div>', '2020-11-14 09:53:20', '2020-11-17 20:14:35', 1);
